import React from 'react';

const Portfolio = () => {
  const clients = [
    {
      name: "Dra. Cylmara Gargalak",
      instagram: "@dracylmara",
      type: "Feed Planning",
      image: "/images/CLIENTS (1).png"
    },
    {
      name: "Dra. Renata Amin Pediatra",
      instagram: "@renata.amin",
      type: "Social Media Design",
      image: "/images/CLIENTS (2).png"
    },
    {
      name: "Dra. Ana Célia Oliveira Nutróloga",
      instagram: "@dra.anaaoliveira_",
      type: "Social Media Design",
      image: "/images/CLIENTS (3).png"
    },
    {
      name: "Ursula Davidoff",
      instagram: "@ursuladavidoff",
      type: "Social Media Design",
      image: "/images/CLIENTS (4).png"
    },
    {
      name: "Movimento Se Enxerga",
      instagram: "@se.enxerga",
      type: "Social Media Design",
      image: "/images/CLIENTS (5).png"
    },
    {
      name: "Os Gilsons",
      instagram: "@gilsonsoficial",
      type: "Digital Illustration",
      image: "/images/CLIENTS (10).png"
    },
    {
      name: "Gabriela Prado Arquitetura",
      instagram: "",
      type: "Brand Design",
      image: "/images/CLIENTS (13).png"
    },
    {
      name: "Altera Arquitetura",
      instagram: "",
      type: "Brand Design",
      image: "/images/CLIENTS (15).png"
    },
    {
      name: "Dra. Polyanna Nascimento",
      instagram: "",
      type: "Brand Design",
      image: "/images/CLIENTS (17).png"
    }
  ];

  return (
    <section className="py-20 bg-cream" id="portfolio">
      <div className="container mx-auto px-4">
        <h2 className="text-4xl md:text-5xl font-serif mb-12 text-center">Portfolio</h2>
        
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {clients.map((client, index) => (
            <div key={index} className="bg-white rounded-lg overflow-hidden shadow-lg hover:shadow-xl transition-shadow">
              <div className="relative pb-[100%]">
                <img
                  src={client.image}
                  alt={client.name}
                  className="absolute inset-0 w-full h-full object-cover"
                />
              </div>
              <div className="p-6">
                <h3 className="text-xl font-semibold mb-2">{client.name}</h3>
                <p className="text-gray-600 mb-2">{client.type}</p>
                {client.instagram && (
                  <a
                    href={`https://instagram.com/${client.instagram.replace('@', '')}`}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="text-blue-600 hover:text-blue-800 transition-colors"
                  >
                    {client.instagram}
                  </a>
                )}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Portfolio;
